<!DOCTYPE html>
<html lang="es">
    <head>
        <meta charset="UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <title>Maintenance Page</title>
        <!-- CSS -->
        <style type="text/css">
            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }

            :root {
                /* Variables */
                --white: #ffffff;
                --platinum: #ebebeb;
                --apple-red: #e01f2f;
                --blue-sapphire: #2b5973;
                --gunmetal: #172b3a;
            }

            body {
                font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI',
                    'Segoe UI Emoji', 'Segoe UI Symbol', Roboto, Helvetica,
                    'Helvetica Neue', Oxygen-Sans, Ubuntu, Cantarell, Arial,
                    sans-serif, 'Apple Color Emoji';
            }

            .maintenance-page-container {
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
            }

            .maintenance-image-container {
                margin: 5rem 0 1.5rem 0;
            }

            .maintenance-image {
                width: 40rem;
            }

            .maintenance-text-container {
                text-align: center;
                color: var(--blue-sapphire);
            }

            .maintenance-title {
                font-size: 3.5rem;
                margin: 0 1.25rem;
                text-shadow: 0.01rem 0.01rem var(--gunmetal);
            }

            .maintenance-subtitle {
                font-size: 2.5rem;
                margin: 1rem 1.5rem;
            }

            @media (max-width: 768px) {
                .maintenance-image {
                    width: 15rem;
                }

                .maintenance-title {
                    font-size: 2rem;
                }

                .maintenance-subtitle {
                    font-size: 1.5rem;
                }
            }
        </style>
    </head>
